import "bootstrap/dist/css/bootstrap.css";

function Footer() {
    return (
        <div>
            <footer className="text-body-secondary py-5">
                <div className="container">
                    <div style={{display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: 0, paddingBottom: 0}}>
                        {/* Group address and phone number together */}
                        <div style={{display: 'flex', alignItems: 'center', padding: '16px'}}>
                            <p style={{marginRight: '20px'}}>Ames, IA 50011-2103</p>
                            <p>Phone: 515-865-8709</p>
                        </div>
                        
                        {/* Contact Me section */}
                        <div style={{padding: '16px', textAlign: 'right'}}>
                            <p className="mb-1">
                                <a href="mailto:chrisrmoseley1@gmail.com" style={{color: 'black'}}>Contact Me</a>
                                <a href="#" style={{marginLeft: '2em', color: 'black'}}>Back to top</a>
                            </p>
                        </div>
                    </div>
                </div>
            </footer>

        </div>
    );
}

export default Footer;
